  \"2015-05-06T22:19:27.042037\",\n\t\"name\": \"eo-scanned-micro-ladar-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this SBIR program we will develop, design
  and build new scanning based micro-ladar sensors with unprecedented small size,
  weight, and power (SWaP), thereby enabling scanning ladar deployment on previously
  inaccessible platforms such as satellites.  The system will range out to &gt; 1
  km, have high frame rates, high resolution (up to 1000 x 1000), high range accuracy
  (&lt; 15 cm), weigh only tens of grams, be constructed from space deployable technologies
  with no-moving parts.  The enabling technology for the proposed Micro-LADAR system
  is a combination of two new electro-optic laser scanning technologies: high speed
  refractive continuous scanners with a 60o?15o field of view (FOV) and diffractive-waveplate
  discrete or step-wise scanners to boost the total FOV up to 120o?120o. The results
  will be a very low-power, long-life (no moving parts), radiation hard, micro-LADAR.\",\n\t\"license_title\":
